                            </div>
                        </div>
                    </div>
                    <div className="col-lg-4">
                        <div className="card">
                            {/*image here*/}
                            <div className="card-body">
                                <h5 className="card-title">My Personal Life </h5>
                                <p className="card-text">This can include your relationships </p>
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-4">
                        <div className="card">
                            {/*image here*/}
                            <div className="card-body">
                                <h5 className="card-title">My Personal Life </h5>
                                <p className="card-text">This can include your relationships </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
     );
}

export default PersonalLife;
